const userLinkEnhancements = require('./enhancements');
const downloadAppLinkEnhancement = require('../download-app-link/enhancement');
const notificationsEnhancement = require('../notifications-link/enhancement');

describe('Mercado Libre Navigation', () => {
  describe('User Link Enhancements', () => {
    it('has the expected enhancements', () => {
      expect(userLinkEnhancements[downloadAppLinkEnhancement.id]).toBeDefined();
      expect(userLinkEnhancements[downloadAppLinkEnhancement.id]).toEqual(downloadAppLinkEnhancement);

      expect(userLinkEnhancements[notificationsEnhancement.id]).toBeDefined();
      expect(userLinkEnhancements[notificationsEnhancement.id]).toEqual(notificationsEnhancement);
    });
  });
});
